function Popup( {display}) {
    const _props = {
        display
    }
    console.log(_props.display)
    return ( 
        <div className={styles[_props.display]}>
            <h2>Hello</h2>
            <button onClick={
                () => {
                    _props.display = 'wrapper-display-none'
                }
            }>click</button>
        </div>
     );
}

export default Popup;
